import { AxiosResponse } from "axios";
import { StatsStore } from "../../store/context/stats";

import api  from './../';

export default class StatsService {
  static get = (id: string): Promise<AxiosResponse<StatsStore>> => {
    return api.get('/stats', { id });
  }

